INSERT INTO `ps_blog_post` (`id_blog_post`,`id_lang`,`date_on`,`status`,`allow_comments`,`title`,`content`,`excerpt`,`link_rewrite`,`meta_keywords`,`meta_description`) VALUES ('1','1','2013-08-30','published','1',' iPod shuffle','<div id=\"short_description_content\" class=\"rte align_justify\">\r\n<p>MacBook makes it easy to hit the road thanks to its tough polycarbonate case, built-in wireless technologies, and innovative MagSafe Power Adapter that releases automatically if someone accidentally trips on the cord.</p>\r\n</div>','MacBook makes it easy to hit the road thanks to its tough polycarbonate case, built-in wireless technologies, and innovative MagSafe Power Adapter that releases automatically if someone accidentally trips on the cord.','-ipod-shuffle','','');
INSERT INTO `ps_blog_post` (`id_blog_post`,`id_lang`,`date_on`,`status`,`allow_comments`,`title`,`content`,`excerpt`,`link_rewrite`,`meta_keywords`,`meta_description`) VALUES ('2','0','2013-09-13','published','0','Blog 1','<p><span>If all these checks are successful, this means we can store the value in our database.</span><br /><span>As we saw earlier in this tutorial, the </span><code>Configuration</code><span> object has just the method we need: </span><code>updateValue()</code><span> will store the new value for </span><code>MYMODULE_NAME</code><span>in the configuration data table.</span></p>','','blog-1','','');
INSERT INTO `ps_blog_post` (`id_blog_post`,`id_lang`,`date_on`,`status`,`allow_comments`,`title`,`content`,`excerpt`,`link_rewrite`,`meta_keywords`,`meta_description`) VALUES ('3','0','2013-09-13','published','0','Blog 2','<p><span>To that, we add a friendly message to the user, indicating that the value has indeed been saved: we use PrestaShop\'s </span><code>displayConfirmation()</code><span>method to add that message as the first data in the </span><code>$output</code><span> variable – and therefore, at the top of the page.</span></p>',NULL,'blog-2',NULL,NULL);
